class Sidepanel extends React.Component {
    render(){
        return (
            <div className="col-md-3">
                <img className="logo" src="/images/JAI PARAKH.png"></img>
                <style jsx>{`
                    .logo{
                        height: 200px;
                        width: 300px;
                    }
                `}</style>
            </div>
        );
    }
}

export default Sidepanel;
